# coding: utf-8

""" divide"""

class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if not s:
            return 0
        self.length = len(s)
        self.s = s
        self.max = 0
        if self.length == 1:
            self.max = 1
        elif len(set(s)) == self.length:
            self.max = self.length
        else:
            self.bisearch(0, self.length)
        return self.max

    def bisearch(self, st, end, flag=False):
        print("start:%s" % st)
        print("end:%s" % end)
        if st+1 == end:
            return

        mid = int((st+end)/2)
        print ("mid:%s" %mid)
        print ("="*20)
        if mid <= self.max:
            return
        if self.track(mid):
            if self.max < mid:
                self.max = mid
            self.bisearch(mid, end, flag)
        else:
            self.bisearch(st, mid)

    def track(self, num):
        print ("num:%s" %num)
        offset = 0
        for i in range(self.length):

            if num+i+offset > self.length:
                break
            else:
                diff = len(self.s[i+offset:num+i+offset]) - len(set(self.s[i+offset:num+i+offset]))
                print ("diff:%s" %diff)
                print (self.s[i:num+i+offset])
                if diff == 0:
                    return True
                elif diff > 0:
                    offset += diff-1

        return False

